import React from 'react';

import { List, Header } from 'semantic-ui-react';

export const Stations = ({ stations }) =>{
  return(
    <List>

    {stations.map(station => {
      return (
        <List.Item key={station.id}>
        <Header>{station.name}</Header>
        </List.Item>
      )
    })}
    </List>
  )
}
